import React from 'react'
import { Image, StyleSheet, View, Text, SafeAreaView } from 'react-native'

const Login = () => {
    const logo = "https://i.postimg.cc/Zn9ScShf/logo.png";
    return (
        <SafeAreaView style={styles.safeArea}>
        <View style={styles.container}>
            <View>
                <Text style={styles.text}>BIENVENIDOS</Text>
                <Image source={{ uri: logo }} style={styles.logo} />
            </View>
        </View>
        </SafeAreaView>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 5,
        alignItems: 'center',
        backgroundColor: '#DEE1E6',
        marginTop: 35,
        marginLeft: 25,
        marginRight: 25,
        marginBottom: 35,
        borderRadius:10
    },
    text:{
        marginTop: 25,
        color: 'black',
        fontSize: 20,
        textAlign: 'center',
        fontWeight: 'bold',        
    },
    logo: {
        marginTop: 30,
        width: 250,
        height: 300, // Ajusta la altura deseada para la imagen
    },
    safeArea: {
        flex: 10,
        backgroundColor: 'white', // Cambia el color del fondo seg√∫n el tema de tu app
      },
})

export default Login;
